/**
 */
Response render(String page,Map<String,Object> context){
  File f=new File(template_directory,page);
  if (!f.exists()) {
    f=new File(template_directory,page + ".html");
  }
  if (!f.exists()) {
    return NanoHTTPD.newFixedLengthResponse(Response.Status.NOT_FOUND,TEXT_MIME,"File not found");
  }
  try {
    String cnts=IvyFile.loadFile(f);
    String ren=doRender(cnts,context);
    return NanoHTTPD.newFixedLengthResponse(Response.Status.OK,HTML_MIME,ren);
  }
 catch (  IOException e) {
    return NanoHTTPD.newFixedLengthResponse(Response.Status.NOT_FOUND,TEXT_MIME,"File not found");
  }
}

String setUserId(int uid) throws SecurityException {
  if (session_id == null) {
    throw new SecurityException("Invalid session");
  }
  url_args.put("userid",Integer.toString(uid));
  Map<String,String> gourl=session_manager.validateLogin(session_id,url_host,url_args,session_cookie,cookie_handler);
  if (gourl == null) {
    cookie_handler.delete(session_cookie);
    throw new SecurityException("Invalid session");
  }
  String gfile=gourl.remove("FILE");
  return gfile;
}

/**
 */
SecurityRequest(String method,String file,String host,Map<String,String> args,NanoHTTPD.CookieHandler cookies,String sessioncookie,SecuritySession sess){
  session_id=cookies.read(sessioncookie);
  if (session_id == null)   session_id=args.get("USID");
  session_manager=sess;
  cookie_handler=cookies;
  session_cookie=sessioncookie;
  url_method=method;
  url_file=file;
  url_host=host;
  url_args=new HashMap<>(args);
}

